import axios from 'axios';

export function getVideoGames(){
    return async function(dispatch){
        const juego = await axios.get('http://localhost:3001/videogames?name=Call of duty');
        return dispatch({
            type: 'GET_VIDEOGAMES',
            payload: juego.data
        })
    }
}
